style.css:
body {
    background-color: #121212; /* Dark background */
    color: #e0e0e0; /* Light text */
    font-family: Arial, sans-serif;
}

header, footer {
    background-color: #1e1e1e;
    color: #ffffff;
    padding: 1rem 0;
    text-align: center;
}

nav ul {
    list-style: none;
    background-color: #2c2c2c;
    text-align: center;
    padding: 0;
    margin: 0;
}

nav ul li {
    display: inline;
}

nav ul li a {
    text-decoration: none;
    color: #ffffff;
    padding: 5px 20px;
    display: inline-block;
}

nav ul li a:hover {
    background-color: #373737;
}

a {
    color: #1e88e5; /* Adjust link color */
}

a:hover {
    color: #64b5f6;
}

h1, h2, h3, h4, h5, h6 {
    color: #fff;
}

